import React, {Component} from 'react';
import {Card} from "antd";
import img_OA from '../../images/production/OA.jpg';

const {Meta}=Card;

class Product extends Component {
    render() {
        return (
            <Card style={{width:"496px",height:"200px"}} cover={<img src={img_OA}/>}>
            <Meta>
                title="OA系统" description="提供基础OA系统"
            </Meta>
            </Card>
        );
    }
}

export default Product;
